INSERT INTO `field_data_field_newsletter_body` VALUES ('newsletter_template','newsletter_template','0','1','1','und','0','Hello [newsletter:subscriber_email],<br />\n\nWe received your request for information from [site:name] <br />\nBefore we begin sending you the information you requested, we want to be certain we have your permission.<br />\nClick the link below to give us permission to send you information. It''s fast and easy!  If you cannot click the full URL below, please copy the URL and paste it into your web browser.<br /><br />\n\nConfirm by clicking the URL below:<br /><br />\n<a href="[newsletter:confirmation_url]">[newsletter:confirmation_url]</a><br /><br />\n\nIf you do not want to subscribe, simply ignore this message.<br /><br />\n\nBest Regards,<br />\n[site:name]<br />\n[site:url]<br /><br />\n\nRequest generated by:<br />\nIP: [newsletter:subscription_ip]<br />\nDate: [newsletter:subscription_time]<br />\n',null,'filtered_html'),('newsletter_template','newsletter_template','0','2','2','und','0','Hello [newsletter:subscriber_email],<br /><br />\n\nThank you for your subscription. You are now signed up to our newsletter!<br />\nWe will keep your personal information private and secure. We will not share your email address with any third parties. <br />\nTo ensure you receive future subscribers-only news, please add this e-mail to your e-mail address book or safe senders list.<br />\n\n\nSincerely,<br />\n[site:name]<br />\n[site:url]<br /><br />\n\n----<br />\nYou are receiving this email because on [newsletter:subscription_time] at [site:url] you subscribed to receive our e-newsletters.<br /><br />\nYou can unsubscribe via the link below:<br />\n<a href="[newsletter:unsubscribe_url]">Unsubscribe</a>\n',null,'filtered_html'),('newsletter_template','newsletter_template','0','3','3','und','0','Dear [newsletter:subscriber_email],<br />\n\nThis email is being sent to notify you that we have received a request to remove the following record from our mailing list:<br /><br />\n\nEmail: [newsletter:subscriber_email]<br /><br />\n\nThis record was removed from our database.<br />\nIf you do receive further unwanted email from our system, please let us know and we''d be happy to address the issue immediately.<br /><br />\n\nSincerely,<br />\n[site:name]<br />\n[site:url] <br />\n',null,'filtered_html');
INSERT INTO `field_data_field_newsletter_body` VALUES ('newsletter_template','newsletter_template','0','4','4','und','0','Hello [newsletter:subscriber_email],<br /><br />\n\nHere is what''s new on <a href="[site:url]">[site:name]</a> over the past few days. Your comments and feedback are always welcome.<br />\n\n<ol>\n [repeat] \n<li><a href="[node:url]">[node:title]</a> -[node:created]<br /> [node:summary]<br /></li>\n [/repeat] \n\n</ol>Sincerely,<br /> <a href="[site:url]">[site:name]</a><br /> <br /> <br />\n\n--<br />You are receiving this email because on [newsletter:subscription_time] you subscribed to receive our newsletter list : [newsletter:list_name].<br /><br />\n\nYou can unsubscribe by clicking the link below:<br /> \n<a href="[newsletter:unsubscribe_url]">Unsubscribe</a><br />\n',null,'filtered_html');
